import sys
from collections import Counter

def f1(f1_p1):
    if len(f1_p1) != 3:
        raise ValueError('Only three numbers is supported via task description.')
    f1_v1 = Counter(f1_p1)
    return f1_v1.most_common(1)[0][0]


if __name__ == '__main__':
    v1 = [int(v2) for v2 in sys.argv[1:]]
    print(f1(v1))
